import style from "./Card.module.css"
  
  export default function Card({ id , name, gender, status, species, origin, image, onClose}) {
   return (
      <div className={style.card}>
         <div className={style.contenedorx}>
            <button className={style.delete} onClick={() => onClose(id)}><svg className={style.cross} xmlns="http://www.w3.org/2000/svg" class="icon icon-tabler icon-tabler-x" width="24" height="24" viewBox="0 0 24 24" stroke-width="2" stroke="currentColor" fill="none" stroke-linecap="round" stroke-linejoin="round"><path stroke="none" d="M0 0h24v24H0z" fill="none"/><path d="M18 6l-12 12" /><path d="M6 6l12 12" /></svg></button>
          </div>
        
         <h2 className={style.heading}>Name: {name}</h2>
         <img src={image} alt='' /> 
         

         <h2>Status: {status}</h2>
         <h2>Species: {species}</h2>
         <h2>Gender: {gender}</h2>
         <h2>Origin: {origin.name}</h2>
      </div>
   );
}
